    <div class="control-space">
        <p style="font-size:20px;padding-bottom:20px;">Create Connection</p>
        <div style="display:flex">
            <select id="selectColor">
                <option value="">- - -</option>
                <option value="red">Red</option>
                <option value="orange">Orange</option>
                <option value="yellow">Yellow</option>
                <option value="green">Green</option>
                <option value="blue">Blue</option>
                <option value="purple">Purple</option>
                <option value="black">Black</option>
                <option value="grey">Grey</option>
            </select><div style="margin-left:35px;"></div>
            <label for = "point1Input" style="min-width:60px;margin-top:1px;">Start ID</label>
            <input type="text" id = "point1Input" style="width:60px;max-height:18px;margin-left:5px;">
            <div style="margin-left:20px"></div>
            <label for="point2Input" style="min-width:60px;margin-top:1px;">End ID</label>
            <input type="text" id="point2Input" style="width:60px;max-height:18px;">
            <button onclick="connectPoints()" style="margin-left:20px;font-size:12px;min-width:40px">send</button>
        </div><br><br>
        <p style="font-size:20px;padding-bottom:20px;">Delete Connection</p>
        <div style="display:flex">
            <label for = "point3Input" style="min-width:60px;margin-top:1px;">Start ID</label>
            <input type="text" id = "point3Input" style="width:60px;max-height:18px;margin-left:5px;">
            <div style="margin-left:20px"></div>
            <label for="point4Input" style="min-width:60px;margin-top:1px;">End ID</label>
            <input type="text" id="point4Input" style="width:60px;max-height:18px;">
            <button onclick="deletePoints()" style="margin-left:20px;font-size:12px;min-width:40px">send</button>
        </div><br><br>
        <p style="font-size:20px;padding-bottom:20px;">Create TTL</p>
        <div style="display:flex">
            <select id="dropdown">
                <option value="">- - -</option>
                <option value="NOT">NOT</option>
                <option value="AND">AND</option>
                <option value="OR">OR</option>
                <option value="XOR">XOR</option>
                <option value="NAND">NAND</option>
                <option value="MUX">MUX</option>
                <option value="7seg">7seg</option>
                <option value="DFF">DFF</option>
                <option value="JKFF">JKFF</option>
                <option value="BCD">BCD</option>
            </select><div style="margin-left:35px;"></div>
            <div style="display:flex">
                <label for = "point5Input" style="min-width:60px;margin-top:1px;">Start ID</label>
                <input type="text" id = "point5Input" style="width:60px;max-height:18px;margin-left:5px;">
                <div style="margin-left:20px"></div>
                <label for="point6Input" style="min-width:60px;margin-top:1px;">End ID</label>
                <input type="text" id="point6Input" style="width:60px;max-height:18px;">
                <button onclick="createTTL()" style="margin-left:20px;font-size:12px;min-width:40px">send</button>
            </div>
        </div><br><br>
        <p style="font-size:20px;padding-bottom:20px;">Delete TTL</p>
        <div style="display:flex">
            <div style="display:flex">

        </div>
